- uid: TensorFlow.TFCode.DeadlineExceeded
  id: DeadlineExceeded
  parent: TensorFlow.TFCode
  langs:
  - csharp
  name: DeadlineExceeded
  nameWithType: TFCode.DeadlineExceeded
  fullName: TFCode.DeadlineExceeded
  type: Field
  assemblies:
  - TensorFlowSharp
  namespace: TensorFlow
  summary: >-
    Deadline expired before operation could complete.  For operations
                that change the state of the system, this error may be returned
                even if the operation has completed successfully.  For example, a
                successful response from a server could have been delayed long
                enough for the deadline to expire.
  syntax:
    content: DeadlineExceeded
    return:
      type: TensorFlow.TFCode
      description: To be added.
  exceptions: []
- uid: TensorFlow.TFCode.FailedPrecondition
  id: FailedPrecondition
  parent: TensorFlow.TFCode
  langs:
  - csharp
  name: FailedPrecondition
  nameWithType: TFCode.FailedPrecondition
  fullName: TFCode.FailedPrecondition
  type: Field
  assemblies:
  - TensorFlowSharp
  namespace: TensorFlow
  summary: "Operation was rejected because the system is not in a state\n             required for the operation's execution.  For example, directory\n             to be deleted may be non-empty, an rmdir operation is applied to\n             a non-directory, etc.\n            \n             A litmus test that may help a service implementor in deciding\n             between FailedPrecondition, Aborted, and Unavailable:\n             \n              (a) Use Unavailableif the client can retry just the failing call.\n              (b) Use Aborted if the client should retry at a higher-level\n                  (e.g., restarting a read-modify-write sequence).\n              (c) Use FailedPrecondition if the client should not retry until\n                  the system state has been explicitly fixed.  E.g., if an \"rmdir\"\n                  fails because the directory is non-empty, FailedPrecondition\n                  should be returned since the client should not retry unless\n                  they have first fixed up the directory by deleting files from it.\n              (d) Use FailedPrecondition if the client performs conditional\n                  REST Get/Update/Delete on a resource and the resource on the\n                  server does not match the condition. E.g., conflicting\n                  read-modify-write on the same resource."
  syntax:
    content: FailedPrecondition
    return:
      type: TensorFlow.TFCode
      description: To be added.
  exceptions: []
