- uid: TensorFlow.TFCode.OutOfRange
  id: OutOfRange
  parent: TensorFlow.TFCode
  langs:
  - csharp
  name: OutOfRange
  nameWithType: TFCode.OutOfRange
  fullName: TFCode.OutOfRange
  type: Field
  assemblies:
  - TensorFlowSharp
  namespace: TensorFlow
  summary: "Operation tried to iterate past the valid input range.  E.g., seeking or\n             reading past end of file.\n            \n             Unlike InvalidArgument, this error indicates a problem that may\n             be fixed if the system state changes. For example, a 32-bit file\n             system will generate InvalidArgument if asked to read at an\n             offset that is not in the range [0,2^32-1], but it will generate\n             OutOfRange if asked to read from an offset past the current\n             file size.\n            \n             There is a fair bit of overlap between FailedPrecondition and\n             OutOfRange.  We recommend using OutOfRane (the more specific\n             error) when it applies so that callers who are iterating through\n             a space can easily look for an OutOfRange error to detect when\n             they are done."
  syntax:
    content: OutOfRange
    return:
      type: TensorFlow.TFCode
      description: To be added.
  exceptions: []
- uid: TensorFlow.TFCode.PermissionDenied
  id: PermissionDenied
  parent: TensorFlow.TFCode
  langs:
  - csharp
  name: PermissionDenied
  nameWithType: TFCode.PermissionDenied
  fullName: TFCode.PermissionDenied
  type: Field
  assemblies:
  - TensorFlowSharp
  namespace: TensorFlow
  summary: >-
    The caller does not have permission to execute the specified
                operation.  PermissionDenied must not be used for rejections
                caused by exhausting some resource (use ResourceExhausted
                instead for those errors).  PermissionDeniedmust not be
                used if the caller can not be identified (use Unauthenticated
                instead for those errors).
  syntax:
    content: PermissionDenied
    return:
      type: TensorFlow.TFCode
      description: To be added.
  exceptions: []
